import React from 'react';
import ProgressUpdater from './ProgressUpdater';
import Hint from './Hint';

class Overloading extends React.Component{
	constructor(props){
		super(props)
		this.state={
			progress: "todo"
		}
	}

	updateProgressState(progress){
		this.setState({
			progress: progress
		});
	}


	render(){
		return (
			<div>
				<ProgressUpdater
	              page={this.props.page} 
	              user={this.props.user}
	              progress={this.state.progress}
	              update={(progress)=>this.updateProgressState(progress)}
	            />
	            mwahaha – we aren't done with <b>functions</b> quite yet! there's one last concept we need to address, called <b>overloading</b>.
	            <h3>overloading, as in you put too many clothes in the laundry machine?</h3>
	            not rly... but appreciate the effort. <b>overloading</b>, or more explicitly called <b>method overloading</b>, allows multiple functions to have the <b>same name</b>, as long as either the <b>number of parameters</b> or the <b>type of parameters</b> are <b>different</b>. (<b className="note">psst. need a reminder</b> on what a parameter is? check out the <b className="pageName">functions page</b>!)
	            <ProgressUpdater
	              page={this.props.page} 
	              user={this.props.user}
	              progress={this.state.progress}
	              update={(progress)=>this.updateProgressState(progress)}
	            />
	            ...we know <b className="note">just for java</b> is as <b>addicting</b> as the newest Netflix binge, so what are you waiting for? <b className="pageName">keep coding!</b>
			</div>
		)
	}
}

export default Overloading;
